					public static FltBaseNode FromBaseObject(BaseObject baseObj)
					{
						if (baseObj == null || baseObj.NativeObject == IntPtr.Zero)
							return null;
						FltBaseNode obj = baseObj as  FltBaseNode;
						if (object.Equals(obj, null))
